import React from 'react';

const style = `
.btn-portfolio {
  height: 50px;
  min-width: 50px;
  width: 150px;
  border: 1px solid white;
  border-radius: 30px;
  color: white;
}
`;

const Buttons = ({ name, logoPath }) => {
  return (
    <div className="btn-portfolio">

      <h4>{name}</h4>
      <style>{style}</style>
    </div>
  );
};

export default Buttons;
